import '../tour/Tour.css'

function Tour(props) {
  return (
    <div>
      {props.DATA3((tour) => (
        <div key={tour.id1}>
          <h2>{tour.name1}</h2>
          <img src={tour.image1} alt={tour.name1} />
        </div>
      ))}
    </div>
  );
}

export default Tour;
